actions.script:
ACTIONS.MESSAGE.STATIC("Misha Niaud",
[
	"$amigo, si quieres te puedo mostrar rápidamente un Pokemon salvaje",
	"Con los Pokemones salvajes tendrás 5 oportunidades de atraparlos, para lograr eso debes primero debilitarlos.",
	"Tu pokebola irá evolucionando mientras más gimnasios logres"
]
,function(){
	ACTIONS.MESSAGE.CHOICE("Misha Niaud", "Quieres ver un Pokemon salvaje?",
	[
		{text: "Si",click: function () {  ACTIONS.POKEMON.BATTLEWILD(function(){ ACTIONS.PROGRESS.SET(1); }); }},
		{text: "No",click: function () {
			ACTIONS.MESSAGE.STATIC("Misha Niaud",
				[
					"$amigo, espero que te vaya bien solo y sin mi ayuda. grrrr!"
				],function(){ 
				   ACTIONS.PROGRESS.SET("NoAyuda");
				});
		}},
	], function () {});
});
